import './App.css';
import {useState, useEffect} from "react"
import {Routes, Route} from "react-router-dom"

function App() {

  const [user, setUser] = useState(null);




  useEffect(() => {
    fetch("/me").then((r) => {
      if (r.ok) {
        r.json().then((user) => setUser(user));
      }
    });
  }, []);























  return (
    <div className="App">

    </div>
  );
}

export default App;
